import React from 'react';

const Navbar = () => {
  return (
    <nav className="bg-gray-800 p-4">
      <div className="container mx-auto">
        <h1 className="text-white text-2xl">Online Shop</h1>
      </div>
    </nav>
  );
};

export default Navbar;
